const JosefinSlab100 = `@font-face { font-family: 'Josefin Slab'; font-style: normal; font-weight: 100; src: local('Josefin Slab Thin'), local('JosefinSlab-Thin'), url('data:font/woff2;base64,') format('woff2'); }`;
